<script>
    import uuid from 'uuid';

    export default {
        name: "k8s",
        data() {
            const validateIsnotnull = (rule, value, callback) => {
                if (value === '') {
                    callback(new Error('不能为空'));
                }else{
                    callback();
                }
            };

            const validateIsNumber = (rule, value, callback) => {
                var reg = /^[1-9]\d*$/;
                if(!reg.test(value)){
                    callback(new Error('请输入正整数!!!!!'));
                }else{
                    callback();
                }
